      *,
      *::before,
      *::after {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }
      
      body {
        min-height: 100vh;
        font-family: "Inter", sans-serif;
        display: flex;
        flex-direction: column;
      }
      
      .container {
        flex-direction: column;
        flex: 1;
        display: flex;
        justify-content: center;
        align-items: center;
      }
      
      header {
        width: 100%;
      }
      
      .logo {
        width: 30px;
      }
      
      nav {
        width: 100%;
        display: flex;
        justify-content: center;
        margin: auto;
        align-items: center;
        gap: 8px;
        padding: 7px 15px;
      }
      
      .left-container {
        display: flex;
        justify-content: center;
        align-items: center;
        gap: 7px;
      }
      
      .input-container {
        display: flex;
        position: relative;
      }
      
      .input-container svg {
        position: absolute;
        left: 15px;
        top: 50%;
        transform: translateY(-50%);
      }
      
      .input {
        border: 0;
        border-radius: 999px;
        padding: 15px 35px;
        background: rgb(240, 240, 240);
        outline: none;
      }
      
      .center-container {
        display: flex;
        align-items: center;
        justify-content: center;
        flex: 1;
        gap: 7px;
      }
      
      .button-link {
        height: 100%;
        display: flex;
        justify-content: center;
        align-items: center;
        padding: 0.65rem 2rem;
        border-radius: 7px;
      }
      
      .button-link:hover {
        background: rgb(234, 234, 234);
        cursor: pointer;
      }
      
      .right-container {
        display: flex;
        justify-content: center;
        align-items: center;
        gap: 15px;
      }
      
      .button-rounded {
        border: 0;
        border-radius: 50%;
        padding: 10px;
        display: flex;
        justify-content: center;
        align-items: center;
        cursor: pointer;
        background: rgb(234, 234, 234);
      }
      
      ul {
        list-style-type: none;
      }
      
      .button-rounded-image img {
        display: flex;
        justify-content: center;
        align-items: center;
        cursor: pointer;
        border-radius: 50%;
        overflow: hidden;
        width: 40px;
      }
      
      .container {
        text-align: center;
        background-color: #f0f2f5;
      }
      
      .title {
        font-size: 1.75rem;
        font-weight: 700;
        margin-bottom: 0.5em;
        color: #4b5563;
      }
      
      .description {
        width: 45%;
        margin: 0 auto;
        margin-bottom: 1.2rem;
        font-size: 1.25rem;
      }
      
      .btn-primary {
        padding: 0.75em 1.25em;
        background: #3b82f6;
        border-radius: 5px;
        font-size: 1rem;
        font-weight: 500;
        color: #fff;
        border: 0;
        margin-bottom: 1rem;
      }
      
      .btn-link {
        color: #3b82f6;
        font-weight: 600;
        margin: 0.25rem 0;
        display: block;
      }
      
      a {
        text-decoration: none;
      }
